export const completeNode = async (nodeId, score) => {
  const response = await fetch(`/api/nodes/${nodeId}/complete`, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({ completedScore: score }),
  });
  if (!response.ok) {
    throw new Error('Failed to complete node');
    console.log(err.error);
  }
  return response.json();
};
